            "description": "创建时间"
          },
          "creator": {
            "type": "string",
            "description": "创建人"
          },
          "deleteFlag": {
            "type": "integer",
            "format": "int32",
            "description": "删除标识"
          },
          "haveFlag": {
            "type": "boolean",
            "example": false,
            "description": "是否有 页面是否是蓝色true 或者灰色false"
