          "id": {
            "type": "integer",
            "format": "int64"
          },
          "operateTime": {
            "type": "string",
            "format": "date-time",
            "description": "操作时间"
          },
          "operator": {
            "type": "string",
            "description": "操作人"
          },
          "orderId": {
            "type": "integer",
            "format": "int64",
            "description": "订单id"
          },
          "orderProcess": {
            "type": "string",
            "description": "订单进度 SUBMIT_ORDER(提交订单),BOOKING_SUCCESSFUL(预订成功),COMPLETION_CAR(完成取车), CONFIRM_RETURN_CAR(完成还车),ORDER_COMPLETED(订单完成),CANCEL_ORDER(取消订单)"
          }
        },
        "description": "订单进度表",
        "$$ref": "#/definitions/订单进度表实体DTO"
      }
    },
    "mapper": {
      "type": "object",
      "additionalProperties": {
