          "type": "object"
        }
      }
    },
    "message": {
      "type": "string"
    },
    "success": {
      "type": "boolean"
    }
  },
  "$$ref": "#/definitions/StatusDto«List«订单进度表实体DTO»»"
}

{
  "type": "object",
