          "type": "object",
          "properties": {
            "carcoreId": {
              "type": "integer",
              "format": "int64",
              "description": "车辆基本信息id，引用车辆基本信息表的id字段"
            },
            "inspectNo": {
              "type": "string",
              "description": "年检记录编号"
            },
            "nextInspectionDate": {
              "type": "string",
              "format": "date-time",
              "description": "下次年检日期"
            },
            "nextStart": {
              "type": "string",
              "format": "date-time",
              "description": "下次年检开始时间"
            },
            "ownerStoreId": {
              "type": "integer",
              "format": "int64",
              "description": "门店id"
            },
            "remark": {
              "type": "string",
              "description": "备注"
            },
            "secondaryCertificatePhoto": {
              "type": "string",
              "description": "行驶证副证盖章照片"
            },
            "yearlyInspectionAgent": {
              "type": "string",
              "description": "年检经办人"
            },
            "yearlyInspectionDate": {
              "type": "string",
              "format": "date-time",
              "description": "本次年检日期"
            }
          },
          "description": "年检信息表",
          "$$ref": "#/definitions/年检信息CarinspectInfoResDTO"
        },
        "carinsuranceInfos": {
          "type": "array",
          "description": "保险",
          "items": {
            "type": "object",
            "properties": {
              "carcoreId": {
                "type": "integer",
                "format": "int64",
                "description": "车辆基本信息id，引用车辆基本信息表的id字段"
              },
              "carinsuranceAgent": {
                "type": "string",
                "description": "经办人"
              },
              "companyName": {
                "type": "string",
                "description": "保险公司名称"
              },
              "createTime": {
                "type": "string",
                "format": "date-time",
                "description": "创建时间"
              },
              "creator": {
                "type": "string",
                "description": "创建人"
              },
              "deleteFlag": {
                "type": "integer",
                "format": "int32",
                "description": "删除标识"
              },
              "id": {
                "type": "integer",
                "format": "int64"
              },
              "insuranceBeginTime": {
                "type": "string",
                "format": "date-time",
                "description": "开始时间"
              },
              "insuranceEndTime": {
                "type": "string",
                "format": "date-time",
                "description": "结束时间"
              },
              "insuranceNo": {
                "type": "string",
                "description": "保险记录编号"
              },
              "insuranceType": {
                "type": "integer",
                "format": "int32",
                "description": "保险类型：1为交强险，2为商业保险"
              },
              "insurantIdentityNumber": {
                "type": "string",
                "description": "被保险人身份证号"
              },
              "insuredCompanyName": {
                "type": "string",
                "description": "被保险公司名称"
              },
              "insuredObject": {
                "type": "integer",
                "format": "int32",
                "description": "被保险对象,1为公司2为个人"
              },
              "insurerName": {
                "type": "string",
                "description": "被保险人姓名"
              },
              "operateTime": {
                "type": "string",
                "format": "date-time",
                "description": "操作时间"
              },
              "operator": {
                "type": "string",
                "description": "操作人"
              },
              "organizationCode": {
                "type": "string",
                "description": "统一社会信用代码"
              },
              "ownerStoreId": {
                "type": "integer",
                "format": "int64",
                "description": "当时门店id"
              },
              "policyNumber": {
                "type": "string",
                "description": "保单号（19位）"
              },
              "policyPhoto": {
                "type": "string",
                "description": "保单照片"
              },
              "remark": {
                "type": "string",
                "description": "备注"
              }
            },
            "description": "车辆保险信息表",
            "$$ref": "#/definitions/车辆保险信息表实体CarinsuranceInfo"
          }
        },
        "carmaintainInfo": {
          "type": "object",
          "properties": {
            "carMileage": {
              "type": "integer",
              "format": "int32",
              "description": "车辆当前里程数"
            },
            "carcoreId": {
              "type": "integer",
              "format": "int64",
              "description": "车辆基本信息id，引用车辆基本信息表的id字段"
            },
            "costPayStatus": {
              "type": "string",
              "description": "费用结算状态"
            },
            "createTime": {
              "type": "string",
              "format": "date-time",
              "description": "创建时间"
            },
            "creator": {
              "type": "string",
              "description": "创建人"
            },
            "deleteFlag": {
              "type": "integer",
              "format": "int32",
              "description": "删除标识"
            },
            "id": {
              "type": "integer",
              "format": "int64"
            },
            "intervalKm": {
              "type": "integer",
              "format": "int32",
              "description": "间隔保养公里数"
            },
            "maintainContent": {
              "type": "string",
              "description": "保养内容描述"
            },
            "maintainCost": {
              "type": "number",
              "description": "保养费用"
            },
            "maintainImages": {
              "type": "string",
              "description": "上传的保养照片的url"
            },
            "maintainNo": {
              "type": "string",
              "description": "保养记录编号"
            },
            "maintainType": {
              "type": "string",
              "description": "保养类型"
            },
            "nextMaintenanceMileage": {
              "type": "integer",
              "format": "int32",
              "description": "到多少公里后需要下次保养"
            },
            "nextMaintenanceTime": {
              "type": "string",
              "format": "date-time",
              "description": "下次保养时间"
            },
            "operateTime": {
              "type": "string",
              "format": "date-time",
              "description": "操作时间"
            },
            "operator": {
              "type": "string",
              "description": "操作人"
            },
            "ownerStoreId": {
              "type": "integer",
              "format": "int64",
              "description": "门店id"
            },
            "remark": {
              "type": "string",
              "description": "备注"
            },
            "serviceManager": {
              "type": "string",
              "description": "客户经理"
            },
            "serviceOrderNo": {
              "type": "string",
              "description": "售后系统中的服务单号"
            }
          },
          "description": "车辆保养表",
          "$$ref": "#/definitions/车辆保养表实体CarmaintainInfo"
        },
        "carrepairInfos": {
          "type": "array",
          "description": "维修",
          "items": {
            "type": "object",
            "properties": {
              "carcoreId": {
                "type": "integer",
                "format": "int64",
                "description": "车辆基本信息id，引用车辆基本信息表(basic_carcore_info)的id字段"
              },
              "id": {
                "type": "integer",
                "format": "int64",
                "description": "id"
              },
              "ownerStoreId": {
                "type": "integer",
                "format": "int64",
                "description": "门店的id"
              },
              "repairNo": {
                "type": "string",
                "description": "维修记录的编号，14位"
              },
              "repairStatus": {
                "type": "string",
                "description": "维修状态包括 REPAIRING(维修中)，REPAIRED(已完成)"
              },
              "repairType": {
                "type": "string",
                "description": "维修类型"
              },
              "serviceOrderNo": {
                "type": "string",
                "description": "售后系统中的服务单号"
              },
              "storeDTO": {
                "type": "object",
                "properties": {
                  "area": {
                    "type": "string",
                    "description": "区"
                  },
                  "city": {
                    "type": "string",
                    "description": "市"
                  },
                  "id": {
                    "type": "integer",
                    "format": "int64",
                    "description": "门店id"
                  },
                  "province": {
                    "type": "string",
                    "description": "省"
                  },
                  "storeName": {
                    "type": "string",
                    "description": "门店名称"
                  }
                },
                "description": "组织架构",
                "$$ref": "#/definitions/门店DTOStoreDTO"
              }
            },
            "description": "车辆维修记录，根据id查询详情的时候使用",
            "$$ref": "#/definitions/车辆维修记录详情实体"
          }
        },
        "carviolationInfos": {
          "type": "array",
          "description": "违章",
          "items": {
            "type": "object",
            "required": [
              "carcoreId",
              "customerDid",
              "handleStatus",
              "ownerStoreId",
              "violationLocation",
              "violationTime",
              "violationType"
            ],
            "properties": {
              "carcoreId": {
                "type": "integer",
                "format": "int64",
                "description": "车辆id"
              },
              "customerDid": {
                "type": "integer",
                "format": "int32",
                "description": "客户是否在租赁期间违章 1.是，0.否"
              },
              "customerName": {
                "type": "string",
                "description": "客户的名字（客户租车期间违章选择：是 必填 否 不填）"
              },
              "handleDescription": {
                "type": "string",
                "description": "违章处理情况描述"
              },
              "handleImage": {
                "type": "string",
                "description": "违章处理图片"
              },
              "handleStatus": {
                "type": "string",
                "description": "违章处理状态，包括UNDEAL(待处理)，DEALED(已处理)"
              },
              "handleTime": {
                "type": "string",
                "format": "date-time",
                "description": "违章处理时间(String类型 例：2017-01-01 12:23:23),违章处理状态为：DEALED(已处理)，必填"
              },
              "leaseOrderNumber": {
                "type": "string",
                "description": "车辆租赁中的订单号（客户租车期间违章选择：是 必填 否 不填）"
              },
              "ownerStoreId": {
                "type": "integer",
                "format": "int64",
                "description": "记录创建时车辆所在门店的id"
              },
              "violationDescription": {
                "type": "string",
                "description": "违章情况描述"
              },
              "violationLocation": {
                "type": "string",
                "description": "违章发生的地点"
              },
              "violationPersonLiable": {
                "type": "string",
                "description": "违章负责人"
              },
              "violationTime": {
                "type": "string",
                "format": "date-time",
                "description": "违章发生的时间(String类型 例：2017-01-01 12:23:23)"
              },
              "violationType": {
                "type": "string",
                "description": "违章类型编号 例：1001A"
              }
            },
            "$$ref": "#/definitions/BizCarviolationInfo"
          }
        }
      },
      "description": "车辆服务DTO",
      "$$ref": "#/definitions/车辆服务DTO"
    },
    "mapper": {
      "type": "object",
      "additionalProperties": {
        "type": "object",
        "additionalProperties": {
          "type": "object"
        }
      }
    },
    "message": {
      "type": "string"
    },
    "success": {
      "type": "boolean"
    }
  },
  "$$ref": "#/definitions/StatusDto«车辆服务DTO»"
}

